import React from 'react';


function Sporty() {
    return (
        <div>
            <h1>Your style type is Sporty. </h1>
            <img alt="" src="https://www.proprofs.com/api/ckeditor_images/New%20Project%20(24)(25).jpg" />
            <h3 className='resultDescr'>You're totally sporty and your clothing style reflects that. You usually pair a jersey with jeans, or opt for the casual top and pants.</h3>
        </div>
    );
};



export default Sporty;
